'πѳʍʜѥ џđƴ πѳ ƴʌџҵє ʙџѫƴ ʍѧʍѧɯѧ ᛖѧҁʌѳʙѧ ҁϯѳџϯ κѧκ ӡѧєѣѧʌ єё χƴєʍ πѳ πџӡđє ѳʜѧ κѧκ ⱀѧκєϯѧ єѣѧʜѧᴙ ʙӡӡʌєϯєʌѧ ʙ ʙѳӡđƴχ џ ӡѧʙџӡѫѧʌѧ',
'ϯƀӀ ѫє πѳʜџʍѧєɯƀ ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ʍѳєʍƴ χƴѥ ʙ đƀӀⱀκƴ ҁʙџҁϯџϯ κѳґđѧ єё ʜƴѫʜѧ πѳʍѳѱƀ ϯʙѳєґѳ ⱀϯѧ',
'ѳʍʜџɯƀ κѧκ ᴙ πѳđκџʜƴʌ ϯʙѳѥ ʍѧϯƀ ʙ ʙѳӡđƴχ џ ѳʜѧ ҁ πџӡƀӀđ ⱀѧҁϯⱀєʌᴙʌѧ ϯʙѳё єѣѧʌѳ ʍѳӌѳӣ',
'ҁʌƴɯѧӣ ϯʙѳᴙ ʍѧϯƀ ʍѳӣ χƴӣ ʜѧӌѧʌѧ ѳϯҁѧҁƀӀʙѧϯƀ κѧκ đџκѧᴙ ѳϯѳⱀʙѧ )',
'ϯƀӀ ѫє πѳʜџʍѧєɯƀ ӌϯѳ ʍѳӣ χƴӣ ѳӌκѳ ϯʙѳєӣ ʍѧϯєⱀџ ҁđѧʌ ʜѧ ϶κҁπєⱀϯџӡƴ )',
'ϯƀӀ ѫє ʙ κƴҁⱀє ӌϯѳ ʍѳӣ χƴӣ ҁϯѧʌ πєⱀʙƀӀʍ ѳѣʌѳđѧϯєʌєʍ κʌџϯѳⱀѧ ϯʙѳєӣ ʍѧϯєⱀџ џ ҁđѧʌ єґѳ ʙ ʌѧʍѣѧⱀđ πѳđ ҁκƴπκƴ πⱀѳđѧѫ ӌϯѳ ѣƀӀ πѳʌƴӌџϯƀ ʜєʍʜѳґѳ đєʜƀѫѧϯ )',
'ҁʌƴɯѧӣ ᴙ ҁʙѳџʍ χƴєʍ ʜѧӌѧʌѧ ѳӌκѳ ϯʙѳєӣ ʍѧϯєⱀџ ʌѳπѧϯƀ κѧκ ʍѳϯѳʜƴѥ ʌѳđκƴ ʜѧ χѳđƴ ҁ ӡѧπѧҁѧʍџ πⱀѳđѳʙѳʌƀҁϯʙєʜʜѳґѳ ӡѧπѧҁѧ πџѱџ đʌᴙ ʍʌєκѳπџϯѧѥѱџχ )',
'ϯƀӀ ѫє ʙ κƴҁⱀє ӌϯѳ ʍѳӣ χƴӣ ʙ ѳӌκє ϯʙѳєӣ ʍѧϯєⱀџ ʜѧӌѧʌѧ πⱀѳʙѳđџϯƀ πⱀѳѻєʌѧκϯџӌєҁκџє ⱀѧѣѳϯƀӀ ,ӌϯѳ ѣƀӀ ѣƀӀʌѳ ʍєʜƀɯє ӡѧⱀґⱀєӡʜᴙєѳҁϯє ʙ ⱀєӌκѧ џ ʙ ʍџʌʌџѳʜџκѧχ ґѳⱀѳđѧχ )',
'ϯƀӀ ѫє πѳʜџʍѧєɯƀ ӌϯѳ ᴙ ҁʙѳџʍ χƴєʍ ʜѧӌѧʌѧ ѳӌκѳ ϯʙѳєӣ ʍѧϯєⱀџ πⱀѳѣџʙѧϯƀ κѧκ ϯⱀѥʍʜƴѥ κѧѥϯƴ πƴɯєӌʜƀӀʍ ҁʜѧⱀᴙđѳʍ ҁ đѧʌƀʜєґѳ ⱀѧҁҁϯѳᴙʜџᴙ )',
'ϯƀӀ ѫє ʙ κƴⱀҁє ӌϯѳ ʍѳӣ χƴӣ ѳӌκѳ ϯʙѳєӣ ʍѧϯєⱀџ ʜѧӌѧʌѧ ʙƀӀϯѧҁκџʙѧϯƀ ҁ πⱀƴđƀӀ κѧκ ӡѧϯѳʜƴʙɯџӣ ϯѧʜκ )',
'ҁʌƴɯѧӣ ʍѳӣ χƴӣ ʙ ѳӌκє ϯʙѳєӣ ʍѧϯєⱀџ ʜѧӌѧʌѧ πⱀѳѫџʙѧϯƀ κѧκ ʙ ѳѣƴҁϯⱀѳџʜѳӣ κʙѧⱀϯџⱀє )',
'ᴙ ҁʙѳӣ χƴӣ πⱀџʌѳѫџʌџ κ πџӡđє ϯʙѳєӣ ʍѧϯєⱀџ κѧκ ʌџҁϯ πѳđѳⱀѳѫʜџκѧ ӌϯѳ ѣƀӀ ѳѣⱀѧѣѳϯѧϯƀ ⱀѧʜƴ )',
'ᴙ ϯʙѳєӣ ʍѧϯєⱀџ ҁʙѳӣ χƴӣ ӡѧ ѱєκƴ πѳʌѳѫџʌ κѧκ ʌѳѫκƴ ʍёđѧ ӌϯѳ ѣƀӀ џӡѣѧʙџϯƀҁᴙ ѳϯ ᴙӡʙƀӀ)',
'ϯƀӀ ѫє πѳʜџʍѧєɯƀ ӌϯѳ ѳӌκѳ ϯʙѳєӣ ʍѧϯєⱀџ κѧκ κѳҁʍѳđⱀѳʍ )',
'ϯƀӀ πѳʜџʍѧєɯƀ ӌϯѳ πⱀџʙџđџ ʍѳєґѳ κʌѥӌѧ ϯʙѳᴙ πџӡđѧ ѳϯⱀƴѣѧєϯҁᴙ ?',
'ϯƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ϯʙѳӣ ⱀѳϯ πⱀџ ʙƀӀҁκѧӡƀӀʙѧʜџᴙ " ҁєӡѧʍ ѳϯκⱀѳӣҁᴙ " ѳʜ đʌᴙ ʍѳєґѳ χƴᴙ ѳϯκⱀƀӀʙѧєϯҁᴙ ?',
'ᴙ ѱѧҁ ҁʙѳџʍ χƴєʍ πєⱀєєѣѧɯƴ πѳ ϯʙѳєӣ ҁπџʜє џ ϯƀӀ ҁʌѳʍѧєɯƀҁᴙ κѧκ џґⱀƴɯκѧ , џ ʍʜє πⱀџӣđєϯҁᴙ ϯєѣᴙ ʙƀӀκџʜƴϯƀ ҁ ѣѧʌκѳʜѧ χƴєʍ)',
'ᴙ ѣƴđƴ ҁʌџɯκѳʍ ґⱀƴѣ ҁ ϯʙѳєӣ ʙѧґџʜѳӣ , ʜƴ џ ϯƀӀ ϯѧʍ ҁđєⱀѫџʙѧӣ ҁєѣᴙ , ʜє κѳʜӌџ ѻѧʜϯѧʜѳʍ ʙ єѣʌѳ ҁʙѳєӣ πѳϯʜѳӣ ʍѧʍѧɯκє)',
'ᴙ ʙ ϯєѣᴙ πєϯѧⱀđƀӀ ӡѧπџχʜƴ, ѳҁєʌ єѣѧʜƀӀӣ) ϯƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ʜѧ ʜѳʙѳӣ ґѳđ ϯʙѳӣ πƴκѧʜ ѣƴđєϯ ҁѧʍƀӀʍ ʍѳѱʜƀӀʍ ʙӡⱀƀӀʙѳʍ ӡѧ ʙҁѥ џҁϯѳⱀџѥ ӌєʌѳʙєӌєҁϯʙѧ?)',
'ᴙ ϯєѣᴙ ѳѣѱџπѧѥ κѧκ κƴⱀџҵƴ єѣѧʜƴѥ) ϯƀӀ ѣƴđєɯƀ ѣєґѧϯƀ πѳ κƴⱀᴙϯʜџκƴ κѧκ ϯʙѳᴙ ʍѧʍѧɯѧ κѳϯѳⱀѧᴙ ҁʜєҁʌѧ ϯєѣᴙ ҁ ґѳʙʜѳʍ)',
'ϯƀӀ ʜѧχƴӣ ʍѳӣ χƴӣ κѧκ ѣⱀѧҁʌєϯ ѳđєʌ ҁєѣє ʜѧ ᴙӡƀӀκ?) χƴєҁѳҁ ѧʜѧʌƀʜƀӀӣ?',
'∏ёҁ ɯѧκѧʌƀʜƀӀӣ?)ϯʙѳџ πѳϯѳʍκџ ґџєʜƀӀ?) χƴʌџ ѳϯ ϯєѣᴙ ʙѳʜᴙєϯ ϯѧκ ҁџʌƀʜѳ)) đџѣʌѳđѳӣđ ҁƴκѧ єѣѧʜƀӀӣ)) ҁѳҁџ χƴӣ)',
'єѣѧʜѧᴙ πѳʌѳʙѧᴙ ҁƴκѧ ϯⱀᴙπκѧ đʌᴙ ʍѳєґѳ χƴᴙ?? ϯʙѳᴙ ʍѧϯƀ ҁʙѳџʍ πџӡđѧκѳʍ ʍѳӣ χƴӣ ϯѳ ʜѧϯџⱀѧʌѧ κѧκ ѣʌᴙϯƀ χƴёʙџʜκѳӣ ϶ϯѳӣ πѧʌκƴ ѳϯ ѣџʌƀᴙⱀđʜѳґѳ ҁϯѳʌѧ) πѳϯѳʍ џґⱀѧʌ ʙ єё κʌџϯⱀє ѣʌᴙϯƀ ʙ κѧκџʍ ϯѳ ӌёⱀʜƀӀʍ χƴёʙ) ѣⱀѳҁѧʌџ κѳʍѳӌκџ ҁʙѳєӣ ҁπєⱀʍƀӀ πѳ ƴґʌѧʍ ʙ πџӡđѧκє ϯʙѳєӣ ʍѧϯєⱀџ 2.ѧ ϯƀӀ πѳʜџʍѧєɯƀ ӌϯѳ ʍѳӣ χƴӣ κѧκ ӌєⱀєπѧɯκѧ ʜџʜӡđᴙ ҁ ϯⱀєʍᴙ ӌёⱀʜƀӀʍџ χƴᴙʍџ đⱀѧʌџҁƀ ҁ πџӡđѧκѳʍ ϯʙѳєӣ ʍѧϯєⱀџ ϯѳ κѧκ ҁѳ ɯⱀєđєⱀѳʍ ѣʌᴙϯƀ?) ѧ ѧʜƴҁ ϯʙѳєґѳ ѳϯҵѧ ϶ϯѳ κѧⱀѳӌ єѣƀӀʌѧ κѧʜѧʌџӡѧҵџᴙ ґđє ʍƀӀ ϯѧʍ єѣѧʌџ ϯʙѳѥ ʍѧϯƀ ҁ ƴӌџϯєʌєʍ) ϯѳӌʜєӣ χƴєʍ ϯʙѳєґѳ ѳϯҵѧ  ',
'Δѧ ϯƀӀ ʜє κџπᴙϯџҁƀ) Ѧ ϯѳ ƴѫє ʙєҁƀ κⱀѧҁʜƀӀӣ, πѳ κʌѧʙє ϯѧκ χƴᴙӌџɯƀ ӌϯѳ ƴѫє πѧʌƀҵƀӀ џҁϯёⱀʌџҁƀ',
'Ѧ ӌϯѳ ѳѣƀӀӌʜѳ κⱀџӌѧϯ ҁƀӀʜƀӀ ѣʌᴙđєӣ κѳґđѧ ҁѳҁƴϯ ѣѳʌƀɯѳӣ ӌʌєʜ?',
'ϯƀӀ πѳӣʍџ, ӌϯѳ ᴙ ϯʙѳєӣ ʍѧϯєⱀџ đєʌѧѥ ƴҁʌƴґƴ, ӌϯѳѣƀӀ ѳʜѧ ʍѳґʌѧ πѳҁϯѳᴙʜʜѳ ʍѳӣ χƴӣ ҁѳҁѧϯƀ џ ʜє ҁϯєҁʜᴙϯƀҁᴙ ʙ πⱀѳҁƀѣє )',
'ϯƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ ϯƀӀ ʌѳχƴɯκѧ єѣѧʜʜѧᴙ, κѳϯѳⱀѧᴙ ʍєđʌєʜʜѳ πџɯєϯ, πѳϯѳʍƴ ӌϯѳ єʍƴ ӌʌєʜ ʍѳӣ ʙ ѫѳπє ʍєɯѧєϯ)',
'ϯƀӀ ʙ κƴⱀҁє, ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ʜѧ ҁϯⱀѳӣκє ⱀѧӡⱀєɯџʌѧ ʍʜє ⱀѧӡʍєҁџϯƀ ʙ єё πџӡđє ⱀѧҁϯʙѳⱀ, ӌϯѳѣƀӀ đѳʍ ҁʌѳѫџϯƀ)',
'ᴙ ϯєѣᴙ ҁєӣӌѧҁ ҁʙѳџʍ χƴєҁ ɯʙƀӀⱀѧʜƴ ʙ ѣƴđκƴ, ѱєʜѳκ, ӌϯѳѣƀӀ ϯƀӀ ʜє ϯᴙʙκѧʌ ʜѧ ʍѳӣ χƴӣ )',
'ϯƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ҁєӣӌѧҁ πѳđ ʍѳӣ χƴӣ πѳđҁϯⱀџґʌѧҁƀ, ҁđєʌѧʌѧ πƴӌѳκ, κѧκ ʜѧ ʌѳѣκє )',
'ᴙ ҁєӣӌѧҁ ϯєѣє ʙ єѣѧʌѳ ҁ χƴᴙ χѧⱀκʜƴ, ӌϯѳѣƀӀ ϯƀӀ πѳʜᴙʌ, ӌϯѳ ᴙ ϯʙѳӣ χѳӡᴙџʜ, ѧ ϯƀӀ ʍѳᴙ ҁѳѣѧκѧ)',
'ϯƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ ϯƀӀ ѻѧʜѧϯєєɯƀ ѳϯ ʍѳєґѳ χƴᴙ, κѧκ ᴙⱀƀӀӣ ѻѧʜѧϯ ʍѳєӣ ӡѧʌƴπƀӀ ʜѧ ʙҁє єѣʌџ ϯʙѳєӣ ʍѧϯєⱀџ πѳκƴπѧєɯƀ ѣџʌєϯƀӀ )',
'ᴙ ϯєѣᴙ ҁєӣӌѧҁ ѣƴđƴ єѣѧϯƀ ʜѧ ʙҁѥ ʙƀӀđєⱀѫκƴ, ӌϯѳѣƀӀ ϯƀӀ πѳʜᴙʌ , ӌϯѳ ʜѧ ʍѳӣ χƴӣ ʙᴙκѧϯƀ ѣєҁπѳʌєӡʜѳ)',
'ϯƀӀ πⱀѳҁϯѳ ҁєӣӌѧҁ ʍѳӣ χƴӣ ҁѳҁџⱀƴєɯƀ џ ʜѧπѳʍџʜѧєɯƀ ѣƀӀʌƀӀє ʙⱀєʍєʜѧ πⱀѳʙєđёʜʜƀӀє ҁ ϯʙѳєӣ ʍѧϯєⱀƀѥ)',
'ϯƀӀ ӡʜѧʌ, ӌϯѳ ϯʙѳᴙ ʍѧϯƀ ʍѳӣ χƴӣ ҁѳҁѧʌѧ, κѳґđѧ đѧ ʍƀӀ єѱё ʙ ɯκѳʌє ƴӌџʌџҁƀ)',
'ϯƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ ᴙ ϯєѣᴙ χƴєʍ џҁϯⱀєѣʌѥ, κѧκ ϯєⱀⱀѳⱀџҁϯѳʙ) πѳϯѳʍƴ ӌϯѳ ϯƀӀ πⱀєđҁϯѧʙʌᴙєɯƀ ƴґⱀѳӡƴ đʌᴙ ʍѳєґѳ χƴᴙ ϯєʍ ҁπѳҁѳѣѳʍ, ӌϯѳ πⱀџκƴҁƀӀʙѧєɯƀ ɯκƴⱀκƴ ʜѧ χƴє ʍѳєʍ )',
'ϯƀӀ ҁєӣӌѧҁ ӡѧχʌєѣʜёɯƀҁᴙ ʍѳєӣ ҁπёⱀʍѳӣ , ʍѳⱀᴙκ ϯƀӀ єѣѧʜʜƀӀӣ , ҁϯƴπѧӣ ҁʙѳџʍ ⱀϯѳʍ πѳ ʍѳєʍƴ χƴѥ, ӌϯѳѣƀӀ ᴙ ϯєѣᴙ ʜє ʙџđєʌ)',
'ϯƀӀ ҁʌƴɯѧӣ ҁѥđѧ, ѱєʜѳκ , ᴙ ϯєѣᴙ єѣƴ џ ѣƴđƴ πѳҁϯѳᴙʜʜѳ πџʜѧϯƀ, πѳϯѳʍƴ ӌϯѳ ϯƀӀ ӡѧʌƴπʜƀӀӣ κʌєѱƀ)',
'ϯƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ ᴙ ϯєѣᴙ ѣƴđƴ ʜѧ ʙҁє 20 ӌѧҁѳʙ ⱀѧҁϯᴙґџʙѧϯƀ ʜѧ ҁʙѳёʍ χƴє, κѧκ πⱀѳҁϯƀӀʜκƴ ) ѧ ϯƀӀ ѣƴđєɯƀ πʌѧκѧϯƀ)',
'ϯƀӀ πѳʜџʍѧєɯƀ, ӌϯѳ ϯƀӀ ҁ ґѳⱀᴙ πƀёɯƀ ʍѳѥ ҁπєⱀʍƴ ʙʍєҁϯѳ ʙѳđκџ ) ᴙ ϯєѣє ʜѧ πѳχѳⱀѳʜƀӀ єѱё ʍѳґƴ ҁʙѳєӣ ʍѳӌџ đѧϯƀ ӡѧπџϯƀ)',
