'❲<emoji document_id=5334626127849724802>🤡</emoji>❳ ꤕꤒꤌઞખ꤇ рખꤟꤌр𑀨 ꤍ ꤙꤣउმꤌӄ꤀𐌼 ꤍꤐ꤀ꤕ꤇ 𐌼ꤌ𐌼ꤌωꤣ ӄꤌӄ ꤍ ൰ꤣተ꤀𐌼 ઞꤌ ꤙ𐌻ꤕપꤕ ꤀ተ ઞꤌꤙꤌმꤕઞꤣꤎ 𐌼꤀ꤕ꤅꤀ 𑀋γꤎ?) ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨 , ተ꤀ પተ꤀ ꤙꤣउმꤌӄ ተꤐ꤀ꤕ꤇ 𐌼ꤌ𐌼ꤌωꤣ ꤒγმꤕተ ꤣउ𐌼ꤕઞёઞ 𐌼꤀ꤣ𐌼 𑀋γё𐌼 , ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨 , ተ꤀ પተ꤀ ꤎ ꤒγმγ ꤙ꤀ ꤍተꤕꤙꤕઞઞ꤀ ꤕꤒꤌተ𑀨 ꤕё ꤐꤍё ꤍꤣ𐌻𑀨ઞꤕꤕ ꤣ ꤍꤣ𐌻𑀨ઞꤕꤕ પተ꤀ꤒખ ꤀ઞꤌ उꤌ꤅ꤣꤒꤌ𐌻ꤌꤍ𑀨 ꤀ተ ꤀р꤅ꤌउ𐌼ꤌ , ω𐌻ળ𑀋ꤌ ተꤐ꤀ꤎ 𐌼ꤌተ𑀨 ꤒ𐌻ꤎ ))) ተખ ӄꤌӄ ꤕꤒꤌઞꤌꤎ ωӄꤌተγ𐌻ӄꤌ 𑀋рꤌઞꤣω𑀨 𐌼꤀꤇ 𑀋γ꤇ γ ꤍꤕꤒꤎ ꤐ꤀ рተγ ꤣ ꤙрꤣ ᤋተ꤀𐌼 ꤍ꤀ꤍёω𑀨 𐌼ઞꤕ ꤕ꤅꤀ ꤍꤐ꤀ꤣ𐌼 მખрꤎꤐખ𐌼 ꤎउખપӄ꤀𐌼  ❲<emoji document_id=5334626127849724802>🤡</emoji>❳',
'❲<emoji document_id=5334626127849724802>🤡</emoji>❳ ꤕꤒꤌઞખ꤇ рખꤟꤌр𑀨 ꤍ ꤙꤣउმꤌӄ꤀𐌼 ꤍꤐ꤀ꤕ꤇ 𐌼ꤌ𐌼ꤌωꤣ ӄꤌӄ ꤍ ൰ꤣተ꤀𐌼 ઞꤌ ꤙ𐌻ꤕપꤕ ꤀ተ ઞꤌꤙꤌმꤕઞꤣꤎ 𐌼꤀ꤕ꤅꤀ 𑀋γꤎ?) ӄ꤀р꤀પꤕ , ተખ ꤙ꤀ઞꤣ𐌼ꤌꤕω𑀨 , ተ꤀ પተ꤀ ꤎ ተꤐ꤀ળ 𐌼ꤌ𐌼ꤌωγ ꤀ꤙγꤍተꤣ𐌻 მ꤀ γр꤀ꤐઞꤎ 𐌼꤀ꤕ꤅꤀ 𑀋γꤎ , ꤌ ꤙ꤀ተ꤀𐌼 ꤙ꤀ꤐꤕꤍꤣ𐌻 ꤕё ઞꤌ ꤍꤐ꤀꤇ 𐌟ꤕ 𑀋γ꤇ ꤣ ઞꤌપꤌ𐌻 ꤕё ωꤐખрꤎተ𑀨 ꤐ рꤌउઞખꤕ ꤍተ꤀р꤀ઞખ)) ተખ γ൰ꤕрꤒઞખ꤇ 𑀋γꤕꤍ꤀ꤍ ꤀მ꤀ꤒрꤎળ൰ꤣ꤇ 𐌼꤀꤇ 𑀋γ꤇ ? )) ꤎ ꤍꤕ꤇પꤌꤍ ተꤐ꤀ꤕ꤇ 𐌼ꤌ𐌼ꤌωꤣ ઞꤌተꤎઞγ ꤙꤣउმꤌӄ ઞꤌ ꤍꤌ𐌼ખ꤇ 𐌼ꤌӄꤍꤣ𐌼γ𐌼 ꤣ उꤌꤍተꤌꤐ𐌻ળ მꤕ𐌻ꤌተ𑀨 𐌼ઞγ 𐌼ꤣઞꤕተ )) ꤙ꤀ተ꤀𐌼 ꤎ ӄ꤀р꤀પꤕ ተꤕꤒꤎ उꤌꤍተꤌꤐ𐌻ળ ꤍ꤀ꤍꤌተ𑀨 𐌼ઞꤕ 𑀋γ꤇ ӄꤌӄ ӄ꤀꤅მꤌ ተ꤀ ꤌꤒꤌ𐌼ꤣ 𐌼ઞꤕ ꤍ꤀ꤍꤌ𐌻 ))  ❲<emoji document_id=5334626127849724802>🤡</emoji>❳',
